import React from 'react';

function ContactPage() {
  return (
    <div style={{ backgroundColor: 'white', padding: '20px', borderRadius: '5px' }}>
      <h1>Kontakt</h1>
      <p>Email: VED@skogen.se</p>
      <p>Telefon: 046-431672</p>
      <p>VED</p>
    </div>
  );
}

export default ContactPage;
